    false,nt"url": null,nt"notes": "The Abandoned Shipwreck Act of 1987 (ASA)
    affirms the authority of state governments to claim ownership to, protect, and manage
    abandoned shipwrecks on state submerged lands. The ASA provides that the laws of
    salvage and finds shall not apply to any shipwreck covered under the Act but recognizes
    that shipwrecks are multiple-use resources. Source: http://www.nps.gov/archeology/tools/laws/asa.htm
    Date Enacted: April 28, 1988 Codification: 43 U.S.C. Section 2101 et seq. Authority:
    U.S. National Park Service When investigating geo-regulatory boundaries near the
    boundary edges, users should consult the most up to date applicable jurisdictional
    boundaries available on MarineCadastre.gov. These geo-regulatory boundaries have
    not been updated in more than 13 years.",nt"license_title": null,nt"extras":
